import {data} from "./data"
import styled from "styled-components"

const Wrapper = styled.div`
  display: grid;
  grid-template-column: 33% 33% 33%;

  img{
  	width: 100%;
  }
`


function Gallery() {	

	const photos = data.map((a, i) =>   <div key={a.id}>
	  <img src={a.img} alt={a.title} />
	</div>)

	return (
	 <Wrapper>
	   {photos}
	 </Wrapper>
	)
}

export default Gallery
